// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@chainlink/contracts/src/v0.8/ChainlinkClient.sol";

contract MockOracle is ChainlinkClient {
    bytes32 public lastRequestId;
    bytes32 public jobId;
    uint256 public constant fee = 0.1 * 10 ** 18; // 0.1 LINK

    function fulfillDataRequest(address _contract, uint256 _data) public {
        Chainlink.Request memory req = buildChainlinkRequest(jobId, _contract, this.fulfill.selector);
        lastRequestId = sendChainlinkRequest(req, fee);
        //ulfillDataRequest(_contract, _data);
    }

    function fulfill(bytes32 _requestId, uint256 _data) public {
        fulfillDataRequest(msg.sender, _data);
    }
}
